import gmpy2
import libnum

def chinese_remainder(a, n):
    sum = 0
    prod = reduce(lambda a, b: a * b, n) #sequentially apply a*b to list n
    for n_i, a_i in zip(n, a):
        p = prod / n_i
        sum += a_i * gmpy2.invert(p, n_i) * p
    return int(sum % prod)

